                new Language{ KeyName ="AttributeExtensions_YearAttribute" , KeyType ="AttributeExtensions", ZhCn ="请输入有效年份格式",ZhHk="請輸入有效的年份格式",EnUs="",IndustryIdArr="0",MainComIdArr="" },
                new Language{ KeyName ="AUTO_MISSING" , KeyType ="GeneralUI_Name", ZhCn ="自动补签",ZhHk="自動補簽",EnUs="AUTO MISSING",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_BASIC_GOV_INSURANCE_DESC" , KeyType ="Modal_PropertyName", ZhCn ="按照香港政府的執行的標準是5%標準計算。最終計算出僱員應收的這部分薪酬，至於公司應繳交的這部分需要自行計算。",ZhHk="按照香港政府的執行的標準是5%標準計算。最終計算出僱員應收的這部分薪酬，至於公司應繳交的這部分需要自行計算。",EnUs="The calculation is based on the 5% standard implemented by the Hong Kong government. The part of the salary receivable by the employee is finally calculated, and the part payable by the company needs to be calculated by itself.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_FINANCE_DESC" , KeyType ="Modal_PropertyName", ZhCn ="上述几个自动计算项完成计算之後,会持续计算账目的总金额,前提是当前账目未结算或者被取消的情况。结算审批需要经过多用户审批流程才能被标注为结算状态。如果公司管理流程简单,可以撤换为单用户审批。",ZhHk="上述幾個自動計算項完成計算之後,會持續計算賬目的總金額,前提是當前賬目未結算或者被取消的情況。結算審批需要經過多用戶審批流程才能被標註為結算狀態。如果公司管理流程簡單,可以撤換為單用戶審批。",EnUs="After the above automatic calculation items are completed, the total amount of the account will continue to be calculated, provided that the current account has not been settled or cancelled. Settlement approval requires a multi-user approval process before it can be marked as settled. If the company management process is simple, it can be replaced by single-user approval.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_PERFORMANCE_BONUS_DESC" , KeyType ="Modal_PropertyName", ZhCn ="如果符合考勤策略，則會自動插入一條未經審核的賬目Account item details明細,如果是獎罰規則的，則自動因應計算情況變更,例如：本月1日開始至10日都是沒有遲到，期間系統持續計算為獎勵狀態，然後後續時間出現多次遲到，突破策略的最低要求，則系統自動把Account item details明細轉為處罰狀態，前提是違規審核的Account item details明細。",ZhHk="如果符合考勤策略，則會自動插入一條未經審核的賬目Account item details明細,如果是獎罰規則的，則自動因應計算情況變更,例如：本月1日開始至10日都是沒有遲到，期間系統持續計算為獎勵狀態，然後後續時間出現多次遲到，突破策略的最低要求，則系統自動把Account item details明細轉為處罰狀態，前提是違規審核的Account item details明細。",EnUs="If it complies with the attendance policy, an unapproved account account item details will be automatically inserted. If it is a reward and penalty rule, it will automatically respond to changes in the calculation situation. For example: there is no lateness from the 1st to the 10th of this month. If the system continues to calculate the status of the reward, and then there are multiple late arrivals in the subsequent time, exceeding the minimum requirements of the policy, the system will automatically convert the Account item details to the penalty status, provided that the Account item details are audited in violation of regulations.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_REQUIRED_APPROVAL" , KeyType ="Modal_PropertyName", ZhCn ="需要审核确认才会纳入账目总额计算。",ZhHk="需要審核確認才會納入賬目總額計算。",EnUs="It needs to be reviewed and confirmed before it will be included in the total account calculation.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_SALARY_ASSESSMENT_DESC" , KeyType ="Modal_PropertyName", ZhCn ="主要是根据月度工作考勤率计算应扣减的薪酬占比。工作考勤率是指迟到或早退的时间扣减占应上班的时间，例如迟到超过允许迟到的值（如15分钟），假设迟到30分钟，累计工作时间是8小时，则今天的工作考勤率是6.3%，又假设按工作天计算的薪酬是100元，则应扣减的薪酬是6.3元。注意：在迟到允许值15分钟内是不计算的，即当天工作考勤率是100%。月度则是累计平均值。",ZhHk="主要是根據月度工作考勤率計算應扣減的薪酬占比。工作考勤率是指遲到或早退的時間扣減占應上班的時間，例如遲到超過允許遲到的值（如15分鐘），假設遲到30分鐘，累計工作時間是8小時，則今天的工作考勤率是6.3%，又假設按工作天計算的薪酬是100元，則應扣減的薪酬是6.3元。注意：在遲到允許值15分鐘內是不計算的，即當天工作考勤率是100%。月度則是累計平均值。",EnUs="It is mainly calculated based on the monthly work attendance rate and the proportion of salary that should be deducted. Work attendance rate refers to the time spent late or leaving early minus the time that should be at work. For example, being late exceeds the allowable lateness value (such as 15 minutes). Assuming that you are late for 30 minutes and the cumulative working time is 8 hours, todays work attendance rate is 6.3%, and assuming that the salary calculated based on working days is 100 yuan, the salary that should be deducted is 6.3 yuan. Note: The lateness allowance within 15 minutes will not be counted, that is, the work attendance rate for the day is 100%. Monthly is the cumulative average.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_SALARY_DEDUCTION_DESC" , KeyType ="Modal_PropertyName", ZhCn ="未按考勤任务完成,则需要按规则扣减余下未完成考勤的那部分薪酬,例如,中途离职,剩下10个工作日未完成,则需要审核并做出扣减,又例如迟到早退严重,按考勤支付率计算人工或者自由工作者来说,这个计算项是非常灵活的计算薪酬的。依据的指标是「1-考勤支付率/总体考勤完成率」。",ZhHk="未按考勤任務完成,則需要按規則扣減餘下未完成考勤的那部分薪酬,例如,中途離職,剩下10個工作日未完成,則需要審核並做出扣減,又例如遲到早退嚴重,按考勤支付率計算人工或者自由工作者來說,這個計算項是非常靈活的計算薪酬的。依據的指標是「1-考勤支付率/總體考勤完成率」。",EnUs="If the attendance task is not completed, the remaining salary for the unfinished attendance needs to be deducted according to the rules. For example, if you leave the company midway and there are 10 working days left to complete, it is necessary to review and make deductions. Another example is that if you are seriously late or leave early, this calculation item is very flexible for calculating wages based on the attendance payment rate for labor or freelance workers. The indicator used is 1-Attendance payment rate/overall attendance completion rate.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_SALARY_DEDUCTION_DESC2" , KeyType ="Modal_PropertyName", ZhCn ="实现上落班灵活自由, 适合自由工作者,或者按照实际工作时间计算薪酬, 或者特俗情况下的薪酬计算。",ZhHk="實現上落班靈活自由, 適合自由工作者,或者按照實際工作時間計算薪酬, 或者特俗情況下的薪酬計算。",EnUs="Achieve flexibility and freedom in commuting and work, suitable for freelance workers, or calculate salary according to actual working hours, or calculate salary under special circumstances.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_SALARY_DEDUCTION_DESC3" , KeyType ="Modal_PropertyName", ZhCn ="例如: 假设 陈大文 每个月20000元薪酬, 按每天8小时计算,但是 每天去工作 1-8小时,随自己工作时间而定,最终按照每天工作的比例计算人工。但这过程中,需要帮太太带孩子,这一个月以来 有日返工,有日没返工,具体有时候返工1小时,有时候8小时,那就按照实际返工时间与要求每天返工8小时的比率计算,就叫「考勤支付率/考勤薪酬率」,完全没有返工,则「考勤支付率/考勤薪酬率」 0%。",ZhHk="例如: 假設 陳大文 每個月20000元薪酬, 按每天8小時計算,但是 每天去工作 1-8小時,隨自己工作時間而定,最終按照每天工作的比例計算人工。但這過程中,需要幫太太帶孩子,這一個月以來 有日返工,有日沒返工,具體有時候返工1小時,有時候8小時,那就按照實際返工時間與要求每天返工8小時的比率計算,就叫「考勤支付率/考勤薪酬率」,完全沒有返工,則「考勤支付率/考勤薪酬率」 0%。",EnUs="For example: Suppose Chen Dawen earns RMB 20,000 per month, based on 8 hours per day, but goes to work 1-8 hours a day, depending on his working hours, and ultimately calculates his salary according to the proportion of his daily work. But in the process, need to help the wife with the children, since this month some days to work, some days not to work, specifically sometimes work 1 hour, sometimes 8 hours, then according to the actual work time and required to work 8 hours a day ratio Calculated, it is called the payment rate, and there is no rework at all, then the payment rate is 0%.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_SALARY_TAX_DESC" , KeyType ="Modal_PropertyName", ZhCn ="个人入息税是所有收支计算得出的收入後按比率扣减相应应缴部分计算。这个税率是预设录入的，需要了解清楚当前考勤人员的个人入息税率是多少比率。",ZhHk="個人入息稅是所有收支計算得出的收入後按比率扣減相應應繳部分計算。這個稅率是預設錄入的，需要了解清楚當前考勤人員的個人入息稅率是多少比率。",EnUs="Personal income tax is calculated by deducting the corresponding payable portion from the income calculated from all income and expenses. This tax rate is entered by default. You need to know clearly what the personal income tax rate of the current attendance staff is.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_SUMMARY1" , KeyType ="Modal_PropertyName", ZhCn ="以上的自動計算項目,是每天或每幾小時自動運行計算的,直至被審核確認才會忽略計算的.或者是月度內持續運行計算,例如考勤策略計算,如果需要每月1號前核算薪酬,那麼需要先對此筆賬目明細進行審核確認。",ZhHk="以上的自動計算項目,是每天或每幾小時自動運行計算的,直至被審核確認才會忽略計算的.或者是月度內持續運行計算,例如考勤策略計算,如果需要每月1號前核算薪酬,那麼需要先對此筆賬目明細進行審核確認。",EnUs="The above automatic calculation items are automatically calculated every day or every few hours, and the calculation will not be ignored until it is reviewed and confirmed. Or the calculation is continuously run within a month, such as attendance policy calculation. If you need to calculate the salary before the 1st of each month, Then the account details need to be reviewed and confirmed first.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_SUMMARY2" , KeyType ="Modal_PropertyName", ZhCn ="为了加强安全起见,凡是涉及有计算机根据业务逻辑计算的账目Account item details账都是需要经过手动审核确认才会被纳入账目总额计算中。同时,",ZhHk="為了加強安全起見,凡是涉及有計算機根據業務邏輯計算的賬目Account item details賬都是需要經過手動審核確認才會被納入賬目總額計算中。同時,",EnUs="In order to enhance security, all Account item details accounts that are calculated by computers based on business logic need to be manually reviewed and confirmed before they are included in the total account calculation. at the same time,",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_SUMMARY3" , KeyType ="Modal_PropertyName", ZhCn ="审批过的记录会以国际安全标准的不对称加密方式验证和保存,确保数据不能直接被改动,只能通过系统流程操作,保证财务数据的安全。",ZhHk="審批過的記錄會以國際安全標準的不對稱加密方式驗證和保存,確保數據不能直接被改動,只能通過系統流程操作,保證財務數據的安全。",EnUs="Approved records will be verified and saved using asymmetric encryption methods of international security standards to ensure that the data cannot be directly altered and can only be operated through system processes to ensure the security of financial data.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AUTOCALC_TITLE" , KeyType ="Modal_PropertyName", ZhCn ="自动计算的账目明细项目",ZhHk="自動計算的賬目明細項目",EnUs="Automatically Calculated Account Detail Items",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AutoCalcMissingType_AutoMissingLunchEnd" , KeyType ="Modal_PropertyName", ZhCn ="自动计算漏打午餐结束",ZhHk="自動計算漏打午餐結束",EnUs="AutoCalc of Lunch End Missings",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="AutoCalcMissingType_AutoMissingLunchStart" , KeyType ="Modal_PropertyName", ZhCn ="自动计算漏打午餐开始",ZhHk="自動計算漏打午餐開始",EnUs="AutoCalc of Lunch Start Missings",IndustryIdArr="",MainComIdArr="" },
