                new Language{ KeyName ="BanApprove_ReturnIsBlockStatus" , KeyType ="ControllerName_ActionMethod_ActionReturnVar", ZhCn ="冻结状态中",ZhHk="凍結狀態中",EnUs="Is Block State",IndustryIdArr="",MainComIdArr="" },
