                new Language{ KeyName ="BusinessErrorCode_ATTENDANCE_EXIST" , KeyType ="Modal_PropertyName", ZhCn ="考勤记录可能已经存在，无效操作",ZhHk="考勤记录可能已经存在，无效操作",EnUs="考勤记录可能已经存在，无效操作",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="BusinessErrorCode_ATTENDANCE_NORMALLY_ADD" , KeyType ="Modal_PropertyName", ZhCn ="正常地插入一条考勤人员{调整}记录",ZhHk="正常地插入一條考勤人員{調整}記錄",EnUs="Normally insert an attendance {adjustment} record",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="BusinessErrorCode_NO_EMPLOYEE" , KeyType ="Modal_PropertyName", ZhCn ="无考勤人员记录",ZhHk="無考勤人員記錄",EnUs="NO EMPLOYEE",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="BusinessErrorCode_NO_SCHEDULE" , KeyType ="Modal_PropertyName", ZhCn ="无排班记录",ZhHk="無排班記錄",EnUs="NO SCHEDULE",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="BusinessErrorCode_NO_SHIFT_SETTING" , KeyType ="Modal_PropertyName", ZhCn ="无考勤设定",ZhHk="無考勤設定",EnUs="NO SHIFT SETTING",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="CalcMissingMode_AUTO" , KeyType ="Modal_PropertyName", ZhCn ="自动",ZhHk="自動",EnUs="AUTO",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="CalcMissingMode_MANUAL" , KeyType ="Modal_PropertyName", ZhCn ="手动",ZhHk="手动",EnUs="MANUAL",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="CalcMissingMode_NOCALC" , KeyType ="GeneralUI_Name", ZhCn ="无计算",ZhHk="无计算",EnUs="无计算",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="CalcMissingMode_RESERVED_TO_DO" , KeyType ="Modal_PropertyName", ZhCn ="RTD",ZhHk="RTD",EnUs="RTD",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="CalcMissingMode_Tips" , KeyType ="Modal_PropertyName", ZhCn ="漏打(漏签)自动计算:目的是较宽松的考勤工作环境实行.<br>如果假设忘记拍卡(人脸识别等),系统会以默认的考勤时间作为记录.<br>如果没有考勤记录,会被视为缺勤,直接影响薪酬计算.如果是少量的漏签则可以通过补签操作实现.",ZhHk="漏打(漏簽)自動計算:目的是較寬鬆的考勤工作環境實行.<br>如果假設忘記拍咭(人臉辨識等),系統會以預設的考勤時間作為記錄.<br>如果沒有考勤記錄,會被視為缺勤,直接影響薪酬計算.如果是少量的漏簽則可以透過補簽操作實現.",EnUs="Automatic calculation of missed punches (missed signatures): The purpose is to implement a looser attendance work environment.<br>If you forget to take a card (face recognition, etc.), the system will use the default attendance time as a record.<br>If there is no attendance Records will be regarded as absenteeism, which will directly affect the calculation of salary. If it is a small amount of missed signatures, it can be achieved by re-signing.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="CalcPeriod_ManualMonthlyDesc" , KeyType ="Modal_PropertyName", ZhCn ="月度手动计算是对当前月以手动形式重新计算（相对后台自动月度计算服务），针对因补签、漏签等原因导致后续手动重新计算。",ZhHk="月度手動計算是對當前月以手動形式重新計算（相對後台自動月度計算服務），針對因補簽、漏籤等原因導致後續手動重新計算。",EnUs="The monthly manual calculation is a manual recalculation of the current month (relative to the automatic monthly calculation service in the background), and manual recalculation is required for subsequent manual recalculations due to supplementary visas, missed visas, and other reasons.",IndustryIdArr="",MainComIdArr="" },
