                new Language{ KeyName ="CarManage_CardDocRuleDesc" , KeyType ="Modal_PropertyName", ZhCn ="规则：NFC白卡先进行建档，把NFC卡的内置物理ID关联到自定义的、可读性的、具有自定义规则的卡号。使拍卡事件POST回来的物理ID能查询到自定义的卡号。这个规则流程的目的是为了建立自己的卡号编号规则，杜绝非法NFC卡攻击。例如：物理ID:PyX6d4f3dD 自定义卡号：A00001",ZhHk="規則：NFC白咭先進行建檔，把NFC咭的內置物理ID關聯到自定義的、可讀性的、具有自定義規則的咭號。使拍咭事件POST回來的物理ID能查詢到自定義的咭號。這個規則流程的目的是為了建立自己的咭號編號規則，杜絕非法NFC咭攻擊。例如：物理ID:PyX6d4f3dD 自定義咭號：A00001",EnUs="Rules: The NFC white card is built relatetionship first, and the built-in physical ID of the NFC card is associated with a custom readable card number with custom manage rules. The physical ID returned from the POST of the card event can be queried to the relate custom card number. The purpose of this rule is to establish your own card numbering rule,and put an end to illegal NFC card attacks. For example: Physical ID: PyX6d4f3dD Custom card number: A00001",IndustryIdArr="",MainComIdArr="" },
