                new Language{ KeyName ="DeviceUser_DevidceUserProfileIdTips" , KeyType ="Modal_PropertyName", ZhCn ="逻辑业务:第一种：根据设备接入的情况而选择 【DevidceUserProfileId】 或者【UserId】作为设备的用户ID,适合设备userID必须为数字的情况下使用.同时EmployeId必须关联UserId(AspNetUSer<=>EMployee)。第二种：海康设备,UserProfileID就是设备用的ID,当成功增加到设备则返回UserProfileID并保存到系统设备用户中. 判断:如果没有UserProfileID则并未下发到设备中.如果EMployeeID没有则未有在系统同步一个来自设备的用户。",ZhHk="邏輯業務:第一種：根據設備接入的情況而選擇 「DevidceUserProfileId」 或者 「UserId」 作為設備的用戶ID,適合設備userID必須為數字的情況下使用.同時EmployeId必須關聯UserId(AspNetUSer<=>EMployee)。第二種：海康設備,UserProfileID就是設備用的ID,當成功增加到設備則返回UserProfileID並保存到系統設備用戶中. 判斷:如果沒有UserProfileID則並未下發到設備中.如果EMployeeID沒有則未有在系統同步一個來自設備的用戶。 ",EnUs="Logical business:The first type: select (DevidceUserProfileId) or (UserId) as the user ID of the device according to the device access situation, which is suitable for use when the device userID must be a number. At the same time, the EmployeId must be associated with the UserId (AspNetUSer<=>EMployee).The second type: Haikang device, UserProfileID is the ID used by the device, when it is successfully added to the device, it will return the UserProfileID and save it to the system device user. Judgment: If there is no UserProfileID, it has not been sent to the device. If the EMployeeID is not, it is not. There is a user from the device synchronized in the system.",IndustryIdArr="",MainComIdArr="" },
