                new Language{ KeyName ="DeviceUserDownSubmitTips" , KeyType ="Modal_PropertyName", ZhCn ="从增加、更改、删除就已经完结，慾要再恢复增加，需要设备列表再次赋值群组，或独立操作增加到当前设备所属群组後，才会下行增加此用户到设备中。",ZhHk="從增加、更改、刪除就已經完結，慾要再恢復增加，需要設備列表再次賦值群組，或獨立操作增加到當前設備所屬群組後，才會下行增加此用戶到設備中。",EnUs="The process of adding, changing, and deleting has been completed. If you want to resume adding, you need to assign the group to the device list again, or add the user to the group that the current device belongs to by independent operation, and then add the user to the device.",IndustryIdArr="",MainComIdArr="" },
