                new Language{ KeyName ="DeviceUserUpdUserProfileIdClear_ReturnOkMsg" , KeyType ="GeneralUI_Name", ZhCn ="处于完成状态(CreatedIsCompleted=true) 和 用户状态处于 GeneralStatus=DEACTIVE 冻结 则 设备人员被删除,回发成功标志回来::DevidceUserProfileId = string.empty",ZhHk="處於完成狀態(CreatedIsCompleted=true) 和 用戶狀態處於 GeneralStatus=DEACTIVE 凍結 則 設備人員被刪除,回發成功標誌回來::DevidceUserProfileId = string.empty",EnUs="In the completed state (CreatedIsCompleted=true) and the user state in GeneralStatus=DEACTIVE is frozen, the equipment personnel will be deleted, and the postback success flag will come back::DevidceUserProfileId = string.empty",IndustryIdArr="",MainComIdArr="" },
