                new Language{ KeyName ="DistributedDotXDaysStatistics_Tips" , KeyType ="Modal_PropertyName", ZhCn ="默认最大统计人数100人，点阵过多，无法清楚表示，建议按照部门统计，提供最近10天和30天的统计数据，坐标X展示的是第几天，不是具体的实际日期。",ZhHk="默認最大統計人數100人，點陣過多，無法清楚表示，建議按照部門統計，提供最近10天和30天的統計數據，坐標X展示的是第幾天，不是具體的實際日期。",EnUs="The default maximum statistic is 100 people. There are too many dots and cannot be clearly expressed. It is recommended to provide statistics for the last 10 days and 30 days according to department statistics. The coordinate X shows the day, not the actual date.",IndustryIdArr="",MainComIdArr="" },
