                new Language{ KeyName ="Employee_AccessCardIdRuleDesc" , KeyType ="Modal_PropertyName", ZhCn ="第一、考勤Card Number和虚拟考勤Card Number是共用一个状态，改变{使用中}，{停用中}都会同时改变这两个Card Number的状态。第二、两种类型都可以同时使用。第三、虚拟卡号是使持有者手机NFC感应区放置NFC卡上。",ZhHk="第一、考勤Card Number和虛擬考勤Card Number是共用一個狀態，改變{使用中}，{停用中}都會同時改變這兩個Card Number的狀態。第二、兩種類型都可以同時使用。第三、虛擬咭號是使持有者手機NFC感應區放置NFC咭上。",EnUs="First. Attendance Card Number and Virtual Attendance Card Number share the same status. Changing {In Use},{Disabled} will change the status of these two Card Numbers at the same time. Second, both types can be used at the same time. Third, the virtual card number is to place the NFC card on the NFC induction area of the holders mobile phone.",IndustryIdArr="",MainComIdArr="" },
