                new Language{ KeyName ="EplyFinanceItem_ApprovedComfirmTips" , KeyType ="Modal_PropertyName", ZhCn ="YES:审核通过；CANCEL:取消会计明细项",ZhHk="YES:審核通過；CANCEL:取消會計明細項",EnUs="YES:APPROVED；CANCEL:Cancel accounting item",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceItem_DRorCRTips" , KeyType ="Modal_PropertyName", ZhCn ="DR表示借方(DEBIT) 会计上该项目金额是加， CR 表示贷方(CREDIT) 会计上该项目金额是减。",ZhHk="DR表示借方(DEBIT) 會計上該項目金額是加， CR 表示貸方(CREDIT) 會計上該項目金額是減。",EnUs="DR means that the amount of the item in the debit (DEBIT) accounting is plus, and CR means that the amount of the item in the credit (CREDIT) accounting is subtract.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceItem_EplyFinanceCloseComfirmTips" , KeyType ="Modal_PropertyName", ZhCn ="当前没有银行账户的关联操作，但注意规则：结算是和现金流相关的操作,表示账目已经现金结算状态。如果取消，则表示和现金脱离关系（坏账）。",ZhHk="當前沒有銀行賬戶的關聯操作，但注意規則：結算是和現金流相關的操作,表示賬目已經現金結算狀態。如果取消，則表示和現金脫離關係（壞賬）。",EnUs="There is currently no associated operation of bank accounts, but pay attention to the rules: settlement is an operation related to cash flow, indicating that the account has been settled in cash. If it is cancelled, it means that it is out of relationship with cash (bad debt).",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceItem_FuncDesc" , KeyType ="Modal_PropertyName", ZhCn ="账目明细分为手动录入和系统自动计算：基本薪酬（经评核审核确认的薪酬），附加固定周期计算的薪酬项目以及预设的税项计算。为了财务计算安全、可复核原则，所有计算的项目都会在明细项目清楚罗列，以便人工结算复核。",ZhHk="賬目明細分為手動錄入和系統自動計算：基本薪酬（經評核審核確認的薪酬），附加固定周期計算的薪酬項目以及預設的稅項計算。為了財務計算安全、可復核原則，所有計算的項目都會在明細項目清楚羅列，以便人工結算復核。",EnUs="The accounts are clearly subdivided into manual entry and system automatic calculation: basic salary (remuneration confirmed by evaluation and review), additional salary items calculated at a fixed period and preset tax calculations. In order to ensure the safety and reviewability of financial calculations, all calculated items will be clearly listed in detailed items for manual settlement review.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceItem_FuncDescSub" , KeyType ="Modal_PropertyName", ZhCn ="借：会计上该项目金额是加，贷：会计上该项目金额是减。",ZhHk="借：會計上該項目金額是加，貸：會計上該項目金額是減。",EnUs="Borrowing: the amount of the item is increased in accounting, and credit: the amount of the item is decreased in accounting.",IndustryIdArr="",MainComIdArr="" },
