                new Language{ KeyName ="EplyFinanceItem_UpdApprovedRule" , KeyType ="Modal_PropertyName", ZhCn ="已审核的记录需要审核本人更改，并且需要重新审核。",ZhHk="已審核的記錄需要審核本人更改，并且需要重新審核。",EnUs="The approved records need to be update by oneself, and need to be approved again.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceItemApproved_IsClosedColFiledTips" , KeyType ="Modal_PropertyName", ZhCn ="结算状态规则说明：当结算状态为关闭(CLOSED)时，则说明此财务明细项已经完结。任何状态以及记录不能被更改。如果是处于【取消状态（CANCEL）】则说明此财务明细会计上完结，但可能没有进行结算，例如100元，但没有产生现金流。",ZhHk="結算狀態規則說明：當結算狀態為關閉(CLOSED)時，則說明此財務明細項已經完結。任何狀態以及記錄不能被更改。如果是處于【取消狀態（CANCEL）】則說明此財務明細會計上完結，但可能沒有進行結算，例如100元，但沒有產生現金流。",EnUs="Settlement status rule description: When the settlement status is CLOSED, it means that this financial item has been closed. Any status and record cannot be changed. If it is in the {CANCEL state (CANCEL)}, it means that the financial details have been completed, but may not have been settled, such as 100 yuan, but no cash flow has been generated.",IndustryIdArr="",MainComIdArr="" },
