                new Language{ KeyName ="EplyFinanceItemName_FuncDesc" , KeyType ="Modal_PropertyName", ZhCn ="财务记账项目名称提供因业务需要收支明细项进行增改，注意名称不能过长而导致影响报表纸张空间。一般2-4字，英文推荐使用字母代码。系统有十几项自设的常用记账项目名称，如需改动可以通过语言字典自定义。",ZhHk="財務記賬項目名稱提供因業務需要收支明細項進行增改，注意名稱不能過長而導致影響報表紙張空間。一般2-4字，英文推薦使用字母代碼。系統有十幾項自設的常用記賬項目名稱，如需改動可以通過語言字典自定義。",EnUs="The name of the financial bookkeeping item is provided for the income and expenditure items to be added and changed due to business needs. Note that the name cannot be too long, which will affect the paper space of the report. Generally 2-4 words, alphabetic codes are recommended for English. The system has more than a dozen self-designed names of commonly used accounting items. If you need to change them, you can customize them through the language dictionary.",IndustryIdArr="",MainComIdArr="" },
