                new Language{ KeyName ="EplyFinanceList_FuncDesc" , KeyType ="Modal_PropertyName", ZhCn ="总共五个账目，按年、按月、按日、按时这几个账目可以同时存在，只要选择结算周期，则自动按周期类别把账目明细归入对应账目。还有一个其他账目，必须要结算完成后才能自动新建一个其他账目。一个人只有一个其他账目。",ZhHk="總共五個賬目，按年、按月、按日、按時這幾個賬目可以同時存在，只要選擇結算周期，則自動按周期類別把賬目明細歸入對應賬目。還有一個其他賬目，必須要結算完成后才能自動新建一個其他賬目。一個人只有一個其他賬目。",EnUs="There are a total of five accounts, which can exist at the same time by year, month, day, and time. As long as the settlement cycle is selected, the account details will be automatically classified into the corresponding accounts according to the cycle category. There is another account, which must be settled before another account can be created automatically. A person has only one other account.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceList_FuncDescSub" , KeyType ="Modal_PropertyName", ZhCn ="账目处于结算状态 ，则为完结的账目。取消状态的账目视为没有现金流账目。",ZhHk="賬目處于結算狀態 ，則為完結的賬目。取消狀態的賬目視為沒有現金流賬目。",EnUs="When the account is in the settlement state, it is a closed account. The accounts in the cancelled state are deemed to have no cash flow accounts.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceList_MonthlyDownloadTips" , KeyType ="Modal_PropertyName", ZhCn ="提示：导出的报表仅仅是月度报表",ZhHk="提示：導出的報表僅僅是月度報表",EnUs="Tip: The exported report is only a monthly report",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceList_OccurDateTimeRangeTips" , KeyType ="Modal_PropertyName", ZhCn ="注意：当前导出Excel月度报表是以当前选择的日期开始作为当前月度的日期范围 ，例如10月13日至12月31，则月度范围是10月1日到31日，条件查询列表则在60天范围内。",ZhHk="注意：當前導出Excel月度報表是以當前選擇的日期開始作為當前月度的日期範圍 ，例如10月13日至12月31，則月度範圍是10月1日到31日，条件查询列表则在60天范围内。",EnUs="Note: The currently exported Excel monthly report starts with the currently selected date as the date range of the current month. For example, from October 13th to December 31st, the monthly range is from October 1st to 31st. The conditional query list is within 60 days.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceList_Title" , KeyType ="Modal_PropertyName", ZhCn ="人员账目与薪酬",ZhHk="人員帳目與薪酬",EnUs="Salary & Finance",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceReportViews_Title" , KeyType ="Modal_PropertyName", ZhCn ="账目概览",ZhHk="賬目概覽",EnUs="Account overview",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceRuleTips_AccountingOpenFlow" , KeyType ="Modal_PropertyName", ZhCn ="持續記賬流程",ZhHk="持續記賬流程",EnUs="Continuous Accounting Flow",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceRuleTips_AccountingOpenFlow1" , KeyType ="Modal_PropertyName", ZhCn ="账目的状态分为与现金相关的状态和与人为操作环节相关的状态，明细流水经过审批後才会被计算,经过计算後,账目可以进入结算流程,一旦被结算,则余下的明细流水账就不再会被纳入计算。账目类型「其他」例外,其他是把相同类型的流水账目(已经审批的)持续纳入计算,直到最後结算或取消(Final Settlement or Cancellation)。",ZhHk="賬目的狀態分為與現金相關的狀態和與人為操作環節相關的狀態，明細流水經過審批後才會被計算,經過計算後,賬目可以進入結算流程,一旦被結算,則余下的明細流水賬就不再會被納入計算。賬目類型「其他」例外,其他是把相同類型的流水賬目(已經審批的)持續納入計算,直到最後結算或取消(Final Settlement or Cancellation)。",EnUs="The status of the accounts is divided into status related to cash and status related to human operation. Detailed journals will be calculated after approval. After calculation, the accounts can enter the settlement process. Once settled, the remaining detailed journals will not be calculated. will be included in the calculation. The exception is the account type Others. Other accounts of the same type (that have been approved) will continue to be included in the calculation until the final settlement or cancellation (Final Settlement or Cancellation).",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceRuleTips_AccountingOpenFlow2" , KeyType ="Modal_PropertyName", ZhCn ="與現金相關的狀態主要有:OPEN > CALCULATED > CLOSED || CANCEL (賬目開啟 > 計算的 > 結算 || 取消)。 當賬目Account item details明細被錄入到審批確認後，賬目建立。如果是系統自動計算的，則狀態為?計算的?。",ZhHk="與現金相關的狀態主要有:OPEN > CALCULATED > CLOSED || CANCEL (賬目開啟 > 計算的 > 結算 || 取消)。 當賬目Account item details明細被錄入到審批確認後，賬目建立。如果是系統自動計算的，則狀態為?計算的?。",EnUs="The main statuses related to cash are: OPEN > CALCULATED > CLOSED || CANCEL (account open > calculated > settlement || canceled). When the account Account item details are entered for approval and confirmation, the account is created. If it is automatically calculated by the system, the status is ?Calculated?.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceRuleTips_Notice1" , KeyType ="Modal_PropertyName", ZhCn ="財務賬目是考勤人員(僱員)基於基本薪酬為前提的賬目計算,如果沒有設定通過<label class=text-danger><strong>審核</strong></label>的評估薪酬,是不可以建立賬目的。當錄入明細賬目後，系統會自動計算屬於什麼類型的賬目，自動歸入該賬目內計算。",ZhHk="財務賬目是考勤人員(僱員)基於基本薪酬為前提的賬目計算,如果沒有設定通過<label class=text-danger><strong>審核</strong></label>的評估薪酬,是不可以建立賬目的。當錄入明細賬目後，系統會自動計算屬於什麼類型的賬目，自動歸入該賬目內計算。",EnUs="Financial accounts are calculated based on the basic salary of attendance personnel (employees). If there is no evaluation salary that passes <label class=text-danger><strong>review</strong></label>, it is not Accounts can be established. After entering detailed accounts, the system will automatically calculate what type of account it belongs to and automatically classify it into the account for calculation.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceRuleTips_Notice2" , KeyType ="Modal_PropertyName", ZhCn ="財務賬目是分為六個類型的，分別是時薪賬目、日薪賬目、週薪賬目、月度薪酬賬目、年度薪酬賬目、其他賬目。",ZhHk="財務賬目是分為六個類型的，分別是時薪賬目、日薪賬目、週薪賬目、月度薪酬賬目、年度薪酬賬目、其他賬目。",EnUs="Financial accounts are divided into six types, namely hourly salary accounts, daily salary accounts, weekly salary accounts, monthly salary accounts, annual salary accounts, and other accounts.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceRuleTips_Notice3" , KeyType ="Modal_PropertyName", ZhCn ="账目是持续开放的(OPEN),无论是月度,小时,周,年度,都是每天不断计算,只要账户是持续开放的,一旦审批后,就会被纳入账目计算的,但是,<br>账目已经被结算或者取消,则账目不会被系统计算,手动计算也不会影响。新增的明细流水也不会被纳入计算,因为账目已经结算。<br>账目明细流水账:只要提交和被系统计算过的(考勤KPI,考勤扣减等等系统自动计算项),然后被审批通过后,就会被纳入计算。",ZhHk="賬目是持續開放的(OPEN),無論是月度,小時,周,年度,都是每天不斷計算,只要賬戶是持續開放的,一旦審批後,就會被納入賬目計算的,但是,<br>賬目已經被結算或者取消,則賬目不會被系統計算,手動計算也不會影響。新增的明細流水也不會被納入計算,因為賬目已經結算。<br>賬目明細流水賬:只要提交和被系統計算過的(考勤KPI,考勤扣減等等系統自動計算項),然後被審批通過後,就會被納入計算。",EnUs="The account is continuously open (OPEN). Whether it is monthly, hourly, weekly, or yearly, it is calculated continuously every day. As long as the account is continuously open, once approved, it will be included in the account calculation. However,<br>If the account has been settled or canceled, the account will not be calculated by the system, and manual calculation will not be affected. The newly added detailed running water will not be included in the calculation because the accounts have already been settled.<br>Account details: As long as it is submitted and calculated by the system (attendance KPI, attendance deduction, etc. automatically calculated by the system), and then approved, it will be included in the calculation.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceRuleTips_Notice4" , KeyType ="Modal_PropertyName", ZhCn ="月度薪酬賬目報表下載,如需重新評核基本薪酬,可以通過新增新的薪酬評估並審核,則係統自動採用最新的已經審核的薪酬作為基本薪酬計算。",ZhHk="月度薪酬賬目報表下載,如需重新評核基本薪酬,可以通過新增新的薪酬評估並審核,則係統自動採用最新的已經審核的薪酬作為基本薪酬計算。",EnUs="Download the monthly salary account report. If you need to re-evaluate the basic salary, you can add a new salary evaluation and review it. The system will automatically use the latest reviewed salary as the basic salary calculation.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceRuleTips_Notice5" , KeyType ="Modal_PropertyName", ZhCn ="?重整计算项目?是指选定薪酬账目类型进行重新计算。例如?2022-12-30 13:59?,如果是年度的,则计算范围是2022年内的,如果是月度薪酬账目,则2022-12范围内的账目,如果选择时薪,则指的是该小时内的范围。",ZhHk="?重整計算項目?是指選定薪酬賬目類型進行重新計算。例如?2022-12-30 13:59?,如果是年度的,則計算范圍是2022年內的,如果是月度薪酬賬目,則2022-12范圍內的賬目,如果選擇時薪,則指的是該小時內的范圍。",EnUs="?Reorganization Calculation Item? refers to the selected salary account type for recalculation. For example ?2022-12-30 13:59?, if it is annual, the calculation range is within 2022, if it is a monthly salary account, then the account within the range of 2022-12, if hourly salary is selected, it refers to the range within hours.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="EplyFinanceRuleTips_title" , KeyType ="Modal_PropertyName", ZhCn ="财务薪酬账目说明与注意事项",ZhHk="財務薪酬賬目說明與注意事項",EnUs="Financial Compensation Account Explanation and Notes",IndustryIdArr="",MainComIdArr="" },
