                new Language{ KeyName ="Roles_SystemRolesRefuseToAddEmployee" , KeyType ="Modal_PropertyName", ZhCn ="含有系统角色的用户不能加入独占性质的雇员角色（EMPLOYEE）",ZhHk="含有系統角色的用戶不能加入獨占性質的雇員角色（EMPLOYEE）",EnUs="Users with SYSTEM roles cannot join exclusive employee roles (EMPLOYEE)",IndustryIdArr="",MainComIdArr="" },
