                new Language{ KeyName ="Roles_ThirdPartyserviceContractorOperator" , KeyType ="Modal_PropertyName", ZhCn ="受托方或服务商的操作员",ZhHk="受托方或服務商的操作員",EnUs="Operator of the trustee or service provider",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="Salary_SalaryAssessPercent_Required" , KeyType ="Modal_PropertyName", ZhCn ="请填入各项评核值，0%不合理。",ZhHk="請填入各項評核值，0%不合理。",EnUs="Please fill in the evaluation values, 0% is unreasonable.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="Salary_SalaryMaxValue_Required" , KeyType ="Modal_PropertyName", ZhCn ="请填入最大评核参考值。",ZhHk="請填入最大評核參考值。",EnUs="Please fill in the maximum evaluation reference value.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryAssessment_FuncDesc" , KeyType ="Modal_PropertyName", ZhCn ="首要第一步是先做薪酬评核，然后审核生效后，系统会按照结算周期自动新增一笔明细账目，目前只开放按月结算周期。只要不确认结算，则每天系统都会更新计算结果。如有新增明细则需要审核才会被计算到对应周期的账目中。",ZhHk="首要第一步是先做薪酬評核，然后審核生效后，系統會按照結算周期自動新增一筆明細賬目，目前只開放按月結算周期。只要不確認結算，則每天系統都會更新計算結果。如有新增明細則需要審核才會被計算到對應周期的賬目中。",EnUs="The first step is to do salary evaluation first, and then after the review takes effect, the system will automatically add a detailed account according to the settlement cycle. Currently, only the monthly settlement cycle is available. As long as the settlement is not confirmed, the system will update the calculation results every day. If there is a new detailed rule, it needs to be reviewed before it will be calculated into the accounts of the corresponding period.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryAssessment_FuncDescSub" , KeyType ="Modal_PropertyName", ZhCn ="BASIC_SALARY 来源基本薪酬的明细账目，SALARY_TAX来源税项设置的明细账目",ZhHk="BASIC_SALARY 來源基本薪酬的明細賬目，SALARY_TAX來源稅項設置的明細賬目",EnUs="BASIC_SALARY source basic salary detailed account, SALARY_TAX source tax setting detailed account",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryAssessment_InvlidAssessValue" , KeyType ="Modal_PropertyName", ZhCn ="无效的薪酬评核值（0）",ZhHk="無效的薪酬評核值（0）",EnUs="Invlid Value Of Salary Assessment",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryAssessment_NotTempAssessmentRequiredEmployee" , KeyType ="Modal_PropertyName", ZhCn ="非临时评核需要确切关联雇员。",ZhHk="非臨時評核需要確切關聯雇員。",EnUs="Non-temporary assessments need to associate employees exactly.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryAssessment_Title" , KeyType ="Modal_PropertyName", ZhCn ="薪酬评核",ZhHk="薪酬評核",EnUs="Salary Assessment",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryDeduction_AccountingCompleteTip" , KeyType ="Modal_PropertyName", ZhCn ="OPEN和CALCULATED表示月度內持續開放計算,月度完結標識為已計算，审核确认后会在账目明细项中插入一条对应的财务项。并且经过审核后才会纳入计算账目。即要通过两次谨慎的审核才会确认的明细项计算。",ZhHk="OPEN和CALCULATED表示月度內持續開放計算,月度完結標識為已計算，審核確認後會在賬目明細項中插入一條對應的財務項。並且經過審核後才會納入計算賬目。即要通過兩次謹慎的審核才會確認的明細項計算。",EnUs="OPEN and CALCULATED indicate that the calculation is continuously open in the month, and the end of the month is marked as calculated. After the verification and confirmation, a corresponding financial item will be inserted into the account detail item. And only after review will be included in the calculation account. That is, line item calculations that require two careful reviews to confirm.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryDeduction_Amount" , KeyType ="Modal_PropertyName", ZhCn ="扣减金额",ZhHk="扣減金額",EnUs="Deduction Amount",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryDeduction_ApprovedTips" , KeyType ="Modal_PropertyName", ZhCn ="如果审批通过，还需要在账目明细流水再次确认才会纳入计算项。",ZhHk="如果審批通過，還需要在賬目明細流水再次確認才會納入計算項。",EnUs="If the approval is approved, it needs to be reconfirmed in the account details before it will be included in the calculation item.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryDeduction_DEBIT" , KeyType ="Modal_PropertyName", ZhCn ="扣减",ZhHk="扣減",EnUs="SAL_DEDU",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryDeduction_EplyItemName" , KeyType ="Modal_PropertyName", ZhCn ="考勤扣减项",ZhHk="考勤扣减項",EnUs="Attendance Deduction",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryDeduction_OverAllCompletedRatioRuleTips" , KeyType ="Modal_PropertyName", ZhCn ="通俗的解释就是: 应扣减未完成的余下结算周期(月度)内的排班,以及迟到早退的工作时间就是考勤应扣减金额。",ZhHk="通俗的解釋就是: 應扣減未完成的余下結算周期(月度)內的排班,以及遲到早退的工作時間就是考勤應扣減金額。",EnUs="The popular explanation is: the unfinished shift schedule in the remaining settlement cycle (monthly) and the working time of arriving late and leaving early are the amount that should be deducted for attendance.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalaryDeduction_Title" , KeyType ="Modal_PropertyName", ZhCn ="薪酬扣减",ZhHk="薪酬扣減",EnUs="Payroll deduction",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_Ability" , KeyType ="Modal_PropertyName", ZhCn ="能力",ZhHk="能力",EnUs="Ability",IndustryIdArr="",MainComIdArr="" },
