                new Language{ KeyName ="SalAssessment_ApprovedComfirmTips" , KeyType ="Modal_PropertyName", ZhCn ="YES:审核通过；NO:拒绝",ZhHk="YES:審核通過；NO:拒绝",EnUs="YES:APPROVED；NO:REJECTED",IndustryIdArr="",MainComIdArr="" },
