                new Language{ KeyName ="SalAssessment_IndustryEthics" , KeyType ="Modal_PropertyName", ZhCn ="行业操守",ZhHk="行業操守",EnUs="_Industry Ethics",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_IndustryReputation" , KeyType ="Modal_PropertyName", ZhCn ="行业声誉评核",ZhHk="行業聲譽評核",EnUs="Industry Reputation",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_InputTheAssessmentMaxValueTips" , KeyType ="Modal_PropertyName", ZhCn ="请输入行业最大薪酬值。例如：行业最大薪酬值是100000。10万，则输入最大值十万。",ZhHk="請輸入行業最大薪酬值。例如：行業最大薪酬值是100000。10萬，則輸入最大值十萬。",EnUs="Please enter the industrys maximum salary value. For example: the industry’s maximum salary value is 100,000. 100,000, then enter the maximum value of 100,000.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_IsTempAssessment" , KeyType ="Modal_PropertyName", ZhCn ="是否临时评核",ZhHk="是否臨時評核",EnUs="Temp Assessment",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_IsTempAssessmentTips" , KeyType ="Modal_PropertyName", ZhCn ="临时评核适用于面试等的需要，而关联对应雇员，适合隽升评核等需要。",ZhHk="臨時評核適用于面試等的需要，而關聯對應雇員，適合雋升評核等需要。",EnUs="Temporary evaluation is suitable for interviews and other needs, while the association corresponds to employees, which is suitable for high-level evaluation and other needs.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_Marriage" , KeyType ="Modal_PropertyName", ZhCn ="测试评核",ZhHk="測試評核",EnUs="Testing Assessment",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_NoScoreWeightTips" , KeyType ="Modal_PropertyName", ZhCn ="没有评分权重的计算结果",ZhHk="沒有評分權重的計算結果",EnUs="Calculation result without scoring weight",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_OperateDateTime" , KeyType ="Modal_PropertyName", ZhCn ="操作日期",ZhHk="操作日期",EnUs="Operate Date",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_Qualifications" , KeyType ="Modal_PropertyName", ZhCn ="资格评核",ZhHk="資格評核",EnUs="Qualifications Assessment",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_Rule1" , KeyType ="Modal_PropertyName", ZhCn ="1、审核通过状态下的薪酬评核才会被系统启用，没有评核记录的情况下，无法进行薪酬计算。",ZhHk="1、審核通過狀態下的薪酬評核才會被系統啟用，沒有評核記錄的情況下，無法進行薪酬計算。",EnUs="1. The salary evaluation will be activated by the system only when the audit is passed. If there is no evaluation record, the salary calculation cannot be performed.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_Rule2" , KeyType ="GeneralUI_Name", ZhCn ="2、通过审核的薪酬评核，如果同一个结算周期下有多个已通过审核的评核，则优先使用最近操作日期的记录。",ZhHk="2、通過審核的薪酬評核，如果同一個結算周期下有多個已通過審核的評核，則優先使用最近操作日期的記錄。",EnUs="2、For audited salary evaluations, if there are multiple audited evaluations in the same settlement cycle, the record of the most recent operation date will be used first.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_Rule3" , KeyType ="GeneralUI_Name", ZhCn ="3、临时评核可以作为面试的薪酬评核，通过姓名做关联。与雇员关联的薪酬评核则作为隽升时候的薪酬提升幅度的评核记录。",ZhHk="3、臨時評核可以作為面試的薪酬評核，通過姓名做關聯。與雇員關聯的薪酬評核則作為雋升時候的薪酬提升幅度的評核記錄。",EnUs="3、Temporary evaluation can be used as salary evaluation for interview, which can be related by name. The salary evaluation associated with the employee is used as the evaluation record of the salary increase at the time of the high rise.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_Rule4" , KeyType ="GeneralUI_Name", ZhCn ="4、薪酬评核可以视为基本薪酬，可以增加其他的附加计算项目，例如基本薪酬=20000，附加薪酬项目：电话津贴，交通津贴，房屋津贴：100,130,190.公司代缴重疾保险10，则合共的薪酬=20000+100+130+190-10",ZhHk="4、薪酬評核可以視為基本薪酬，可以增加其他的附加計算項目，例如基本薪酬=20000，附加薪酬項目：電話津貼，交通津貼，房屋津貼：100,130,190.公司代繳重疾保險10，則合共的薪酬=20000+100+130+190-10",EnUs="4. Salary evaluation can be regarded as basic salary, and other additional calculation items can be added, such as basic salary=20,000, additional salary items: telephone allowance, transportation allowance, housing allowance: 100,130,190. The company pays critical illness insurance 10 on behalf of the company, then the total Salary = 20000+100+130+190-10",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_Rule5" , KeyType ="Modal_PropertyName", ZhCn ="5、财务账目计算业务之一就是薪酬计算，该账目是薪酬计算核心=薪酬评核+附加薪酬计算项目。",ZhHk="5、財務賬目計算業務之一就是薪酬計算，該賬目是薪酬計算核心=薪酬評核+附加薪酬計算項目。",EnUs="5. One of the business of financial account calculation is salary calculation. This account is the core of salary calculation = salary evaluation + additional salary calculation project.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_Rule6" , KeyType ="Modal_PropertyName", ZhCn ="注意：薪酬评估新增后，会自动增加设置默认的个人所得税。税率是系统设置的默认值，如不适合，请从薪酬税率列表中删除，并重新适当增加。",ZhHk="注意：薪酬評估新增后，會自動增加設置默認的個人所得稅。稅率是系統設置的默認值，如不適合，請從薪酬稅率列表中刪除，并重新適當增加。",EnUs="Note: After the salary assessment is added, the default personal income tax will be automatically added. The tax rate is the default value set by the system. If it is not suitable, please delete it from the list of salary tax rates and increase it appropriately.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_SalaryAssessmentValue" , KeyType ="Modal_PropertyName", ZhCn ="综合评核值",ZhHk="綜合評核值",EnUs="Salary Assessment Value",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_SalaryMaxValue" , KeyType ="Modal_PropertyName", ZhCn ="目标最大值",ZhHk="目標最大值",EnUs="Salary Max Value",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_SalaryMaxValueTips" , KeyType ="Modal_PropertyName", ZhCn ="请先输入目标评核最大值。假设最理想状态下，完全符合最优秀标准下的薪酬待遇，则此薪酬值为目标薪酬最大值。",ZhHk="請先輸入目標評核最大值。假設最理想狀態下，完全符合最優秀標準下的薪酬待遇，則此薪酬值為目標薪酬最大值。",EnUs="Please enter the target evaluation maximum value first. Assuming that in the ideal state, the salary package under the best standard is fully met, the salary value is the maximum value of the target salary.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_ScoreWeight" , KeyType ="Modal_PropertyName", ZhCn ="评分权重(累计100分)",ZhHk="評分權重(累計100分)",EnUs="Score Weight(100 points accumulated)",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_SettlePeriodMode" , KeyType ="Modal_PropertyName", ZhCn ="结算周期",ZhHk="結算周期",EnUs="Settle Period",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_SettlePeriodModeTips" , KeyType ="Modal_PropertyName", ZhCn ="结算模式规则：每人只能有一种结算模式，例如：时薪结算模式，则只有一条记录。重新录入则需要删除当前结算模式。注意：定期调度计算薪酬的时候，如果没有该结算模式，则会导致没有此选项的计算。例如：每月薪酬，错误把月度薪酬评核删除，将会导致本月无法出薪酬报表和财务报表缺失该计算等。",ZhHk="結算模式規則：每人只能有一種結算模式，例如：時薪結算模式，則只有一條記錄。重新錄入則需要刪除當前結算模式。注意：定期調度計算薪酬的時候，如果沒有該結算模式，則會導致沒有此選項的計算。例如：每月薪酬，錯誤把月度薪酬評核刪除，將會導致本月無法出薪酬報表和財務報表缺失該計算等。",EnUs="Settlement mode rules: each person can only have one salary settlement mode, for example: hourly salary settlement mode, there is only one record. To re-enter, you need to delete the current salary settlement mode. Note: When the salary is calculated by monthly schedule, if the settlement mode is not available, it will result in no calculation of this option. For example: monthly salary, if the monthly salary evaluation is deleted by mistake, the salary statement will not be issued this month and the financial statement will be missing the calculation.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessment_TempAssessment" , KeyType ="Modal_PropertyName", ZhCn ="临时评核",ZhHk="臨時評核",EnUs="Temp Assessment",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessmentApproved_NoEmployeeId" , KeyType ="Modal_PropertyName", ZhCn ="没有关联的员工，审核薪酬毫无意义。(录入时选择了临时评核）",ZhHk="沒有關聯的員工，審核薪酬毫無意義。(錄入時選擇了臨時評核）",EnUs="Without associated employees, there is no point in reviewing compensation. (Temporary evaluation was selected during entry)",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalAssessmentDelete_ComfirmTips" , KeyType ="GeneralUI_Name", ZhCn ="删除将会导致月度|周度|年度等的薪酬计算缺失此项。如需要新的评核审核，则需要删除旧的年|月|日|时度薪酬评核。",ZhHk="刪除將會導致月度|周度|年度等的薪酬計算缺失此項。如需要新的評核審核，則需要刪除舊的年|月|日|時度薪酬評核。",EnUs="Deleting will result in missing this item in the monthly|yearly|weekly|dayly|hourly salary calculation",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalTaxRate_DefaultInsFailTips" , KeyType ="Modal_PropertyName", ZhCn ="未能增加默认的个税记录，请另行增加，否则导致无法计算薪酬。",ZhHk="未能增加默認的個稅記錄，請另行增加，否則導致無法計算薪酬。",EnUs="Failed to add the default personal tax record, please add another, otherwise the salary cannot be calculated.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalTaxRate_DefaultInsSuccTips" , KeyType ="Modal_PropertyName", ZhCn ="成功增加默认个税记录。",ZhHk="成功增加默認個稅記錄",EnUs="Successfully added default tax records",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalTaxRate_FuncDesc" , KeyType ="Modal_PropertyName", ZhCn ="薪酬税项，分比率和定额计算，例如薪酬100元，税率15%，定额5元，则税项合计=100X15%+5,可以设为0，这样灵活处理税项问题，适应不同的薪酬税制度。系统会以项目明细记录以便复核计算查错。",ZhHk="薪酬稅項，分比率和定額計算，例如薪酬100元，稅率15%，定額5元，則稅項合計=100X15%+5,可以設為0，這樣靈活處理稅項問題，適應不同的薪酬稅制度。系統會以項目明細記錄以便復核計算查錯。",EnUs="Salary tax, calculated by ratio and fixed amount. For example, salary is 100 yuan, tax rate is 15%, fixed amount is 5 yuan, then the total tax = 100X15%+5, which can be set to 0, which can handle tax issues flexibly and adapt to different salary taxes system. The system will record the item details for the purpose of reviewing calculations and checking errors.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalTaxRate_FuncDescSub" , KeyType ="Modal_PropertyName", ZhCn ="提供财务簿记项目的名称，以便根据业务需要添加和更改收入和支出项目。 ",ZhHk="提供財務簿記項目的名稱，以便根據業務需要添加和更改收入和支出項目。",EnUs="The name of the financial bookkeeping item is provided for the income and expenditure items to be added and changed due to business needs. Note that the name cannot be too long, which will affect the paper space of the report. Generally 2-4 words, alphabetic codes are recommended for English. The system has more than a dozen self-designed names of commonly used accounting items. If you need to change them, you can customize them through the language dictionary.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalTaxRate_Quota" , KeyType ="Modal_PropertyName", ZhCn ="定额税",ZhHk="定額稅",EnUs="Fixed tax",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalTaxRate_Ratio" , KeyType ="Modal_PropertyName", ZhCn ="薪酬税率",ZhHk="薪酬稅率",EnUs="Tax Ratio",IndustryIdArr="",MainComIdArr="" },
