                new Language{ KeyName ="SalTaxRateNote" , KeyType ="Modal_PropertyName", ZhCn ="关于社会保险或个人所得税在此设定，没有设定则不会计算，此项分两种方式计算：第一是按照比率扣除；第二是按照定额扣除，两种方式同时起作用的，只要数值大于0。",ZhHk="關于MPF或個人所得稅在此設定，沒有設定則不會計算，此項分兩種方式計算：第一是按照比率扣除；第二是按照定額扣除，兩種方式同時起作用的，只要數值大于0。",EnUs="Regarding the MPF or the personal income tax setting here, it will not be calculated if there is no setting. This item is calculated in two ways: the first is to deduct according to the rate; the second is to deduct according to the fixed amount. Both methods work at the same time, as long as the value is greater than 0 .",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalTaxRateNoteRatioTips" , KeyType ="Modal_PropertyName", ZhCn ="比率规则是累计账目明细项乘以比率再加上固定额度定义的,即Tax=Amount*15%+Quota.例如薪酬1000000x15%+600=1500600.实际薪酬就是10000000-150500=849500；如果比率设置为0或定额设置为0，则意义不扣减税率，或扣减其中一项。",ZhHk="比率規則是累計賬目明細項乘以比率再加上固定額度定義的,即Tax=Amount*15%+Quota.例如薪酬1000000x15%+600=1500600.實際薪酬就是10000000-150500=849500；如果比率設置為0或定額設置為0，則意義不扣減稅率，或扣減其中一項。",EnUs="The ratio rule is defined by multiplying the accumulated account details by the ratio plus a fixed amount, namely Tax=Amount*15%+Quota. For example, salary 1000000x15%+600=1500600. The actual salary is 10000000-150500=849500; if the ratio is set to If 0 or the fixed amount is set to 0, it means that the tax rate will not be deducted, or one of them will be deducted.",IndustryIdArr="",MainComIdArr="" },
