                new Language{ KeyName ="SalWelfareCalc_DRorCRTips" , KeyType ="Modal_PropertyName", ZhCn ="DR表示借方(DEBIT) 会计上该项目金额是加， CR 表示贷方(CREDIT) 会计上该项目金额是减。",ZhHk="DR表示借方(DEBIT) 會計上該項目金額是加， CR 表示貸方(CREDIT) 會計上該項目金額是減。",EnUs="DR means that the amount of the item in the debit (DEBIT) accounting is plus, and CR means that the amount of the item in the credit (CREDIT) accounting is subtract.",IndustryIdArr="",MainComIdArr="" },
                new Language{ KeyName ="SalWelfareCalc_FuncDesc" , KeyType ="Modal_PropertyName", ZhCn ="由于KPI需要，把薪酬分为基本薪酬（评核薪酬）和附加薪酬项目两部分以作灵活处理薪酬奖罚机制，具体视乎需要加以灵活运用，附加经常项目，例如固定饭餐津贴，固定话费津贴，如需变数则每个项目明细逐一录入。",ZhHk="由於KPI需要，把薪酬分為基本薪酬（評核薪酬）和附加薪酬項目兩部分以作靈活處理薪酬獎罰機制，具體視乎需要加以靈活運用，附加經常項目，例如固定飯餐津貼，固定話費津貼，如需變數則每個項目明細逐一錄入。",EnUs="Due to the needs of KPIs, the salary is divided into two parts: basic salary (evaluated salary) and additional salary items for flexible handling of salary rewards and penalties, which can be used flexibly according to needs, and additional current items, such as fixed meal allowance and fixed telephone allowance , If you need variables, enter the details of each item one by one.",IndustryIdArr="",MainComIdArr="" },
